.nuclide-diff-view-container {
  height: 100%;
  width: 100%;
  display: flex;
  flex-direction: column;
  -webkit-user-select: none;
}
.nuclide-diff-view-component {
  flex-grow: 1;
  /* Let the `<atom-pane-container>` fill the height since it already has `flex: 1` applied. */
  display: flex;
}
.nuclide-diff-view-removable-tag {
  margin-left: 2px;
  margin-right: 2px;
  float: left;
}
.nuclide-diff-view-padded {
  margin-left: 17px;
}
.nuclide-diff-view-editor-loading {
  pointer-events: none;
  opacity: 0.5;
}
.nuclide-diff-view-read-only-editor {
  opacity: 0.8;
}
.nuclide-diff-view-pane-loading-indicator {
  align-items: center;
  display: flex;
  height: 100%;
  justify-content: center;
  position: absolute;
  top: 0;
  width: 100%;
}
.nuclide-diff-timeline {
  z-index: 3;
  border-top: 1px solid #181a1f;
  width: 100%;
  color: #9da5b4;
}
.nuclide-diff-timeline .text-monospace {
  font-family: Menlo, Consolas, monospace;
}
.nuclide-diff-timeline .revision {
  position: relative;
  cursor: pointer;
}
.nuclide-diff-timeline .revision-timeline-wrap {
  height: 100%;
  overflow: auto;
}
.nuclide-diff-timeline .revision-selector {
  width: 100%;
  white-space: nowrap;
  display: flex;
}
.nuclide-diff-timeline .revisions {
  display: flex;
  flex-direction: column;
  position: relative;
}
.nuclide-diff-timeline .revision:hover .revision-label {
  font-weight: bold;
}
.nuclide-diff-timeline .revision:hover .revision-bubble {
  background-color: #6494ed;
  box-shadow: 0 0 0 2px #6494ed;
}
.nuclide-diff-timeline .revision:hover .revision-bubble--uncommitted {
  background-color: #e2c08d;
  box-shadow: 0 0 0 2px #e2c08d;
}
.nuclide-diff-timeline .nuclide-diff-rev-side-button {
  margin-left: 0.4em;
}
.nuclide-diff-timeline .revision-bubble {
  background-color: #6494ed;
  border-radius: 10px;
  float: left;
  height: 10px;
  width: 10px;
  margin: 4px;
}
.nuclide-diff-timeline .revision-bubble::after {
  bottom: -8px;
  /* Pull into the revision bubble below */
  content: " ";
  display: block;
  width: 1px;
  background-color: #6494ed;
  margin-left: 5px;
  position: absolute;
  top: 5px;
  z-index: -1;
}
.nuclide-diff-timeline .revision-bubble--uncommitted {
  background-color: #e2c08d;
}
.nuclide-diff-timeline .selected-revision-inrange .revision-bubble:after {
  background: #6494ed;
  content: " ";
  margin-left: 1px;
  margin-right: 1px;
  width: 8px;
}
.nuclide-diff-timeline .revision-bubble--uncommitted:after {
  background: linear-gradient(to bottom, #e2c08d, #6494ed);
}
.nuclide-diff-timeline .selected-revision-last .revision-bubble::after {
  display: none;
}
.nuclide-diff-timeline .revision-label {
  margin-bottom: 12px;
  margin-left: 24px;
}
.nuclide-diff-timeline .selected-revision-start,
.nuclide-diff-timeline .selected-revision-end {
  font-weight: bold;
}
.nuclide-diff-timeline .selected-revision-inrange .revision-label,
.nuclide-diff-timeline .selected-revision-end .revision-label {
  color: #6494ed;
}
.nuclide-diff-timeline .selected-revision-start .revision-label {
  color: #e2c08d;
}
.nuclide-diff-timeline .selected-revision-start .revision-bubble {
  box-shadow: 0 0 0 4px rgba(226, 192, 141, 0.25);
}
.nuclide-diff-timeline .selected-revision-end .revision-bubble {
  box-shadow: 0 0 0 4px rgba(100, 148, 237, 0.25);
}
.diff-view-count.tool-bar-btn::after {
  content: attr(data-count);
  font-size: 0.8em;
  margin-top: 13px;
  position: absolute;
  text-shadow: 0 0px 2px #181a1f;
}
.diff-view-count.tool-bar-btn.max-count::after {
  margin-left: -4px;
}
.diff-view-count.tool-bar-btn.positive-count {
  color: #e2c08d;
}
.diff-view-count.tool-bar-btn.positive-count:hover {
  color: #e2c08d;
}
.nuclide-diff-view-block-offset {
  width: 100%;
  background: repeating-linear-gradient(-45deg, #2f333d, #2f333d, 5px, transparent 5px, transparent 10px);
}
atom-text-editor .diff-view-insert .region,
atom-text-editor::shadow .diff-view-insert .region {
  border-left-style: solid;
  border-left-color: #73c990;
  border-left-width: 1px;
  background-color: rgba(115, 201, 144, 0.1);
}
atom-text-editor .diff-view-delete .region,
atom-text-editor::shadow .diff-view-delete .region {
  border-left-style: solid;
  border-left-color: #ff6347;
  border-left-width: 1px;
  background-color: rgba(255, 99, 71, 0.1);
}
.nuclide-diff-view-navigation-bar {
  height: 100%;
  width: 100%;
}
.nuclide-diff-editor-container {
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}
.nuclide-diff-editor-wrapper {
  display: flex;
  flex-grow: 1;
  position: relative;
}
.nuclide-diff-view-lint-excuse {
  flex: 1;
  margin-left: 3px;
  margin-right: 3px;
}
.publish-toolbar-wrapper .nuclide-ui-toolbar__left {
  flex: 2;
}
.nuclide-diff-mode {
  z-index: 3;
  display: flex;
  width: 100%;
  flex-direction: column;
  border-top: 1px solid #181a1f;
}
.nuclide-diff-mode .message-editor-wrapper {
  display: flex;
  flex-grow: 1;
  position: relative;
}
.nuclide-diff-mode .commit-form-wrapper {
  background-color: inherit;
  margin-left: 5px;
  margin-right: 5px;
  overflow-y: auto;
  /*
     * overriding styles for atom-text-editor to make mini and multiline
     * editor have the similar color schemes based on the themes.
     */
  /*
     * This is to prevent the cursor line to have a different background
     * compared to the mini atom inputs.
     *
     * Ref: https://atom.io/packages/block-cursor
     */
}
.nuclide-diff-mode .commit-form-wrapper atom-text-editor,
.nuclide-diff-mode .commit-form-wrapper atom-text-editor[mini] {
  background-color: #1b1d23;
  line-height: 25px;
  border-radius: 3px;
  padding-left: 5px;
  color: #d7dae0;
  font-size: 14px;
}
.nuclide-diff-mode .commit-form-wrapper atom-text-editor.is-focused,
.nuclide-diff-mode .commit-form-wrapper atom-text-editor[mini].is-focused {
  border-color: #3a3f4b;
  box-shadow: 0 0 0 1px #3a3f4b;
  color: #d7dae0;
}
.nuclide-diff-mode .commit-form-wrapper atom-text-editor.is-focused::shadow .cursor,
.nuclide-diff-mode .commit-form-wrapper atom-text-editor[mini].is-focused::shadow .cursor {
  border-color: #d7dae0;
  border-width: thin;
}
.nuclide-diff-mode .commit-form-wrapper atom-text-editor::shadow .lines .line.cursor-line {
  background-color: transparent;
}
.nuclide-diff-view-navigation-target {
  position: absolute;
  width: 100%;
  cursor: pointer;
  text-align: center;
}
.nuclide-diff-view-navigation-target.added {
  background-color: #2ba143;
}
.nuclide-diff-view-navigation-target.removed {
  background-color: #d13b2e;
}
.nuclide-diff-view-navigation-target.modified {
  background-color: #ad7c0b;
}
.nuclide-diff-view-navigation-target.icon {
  z-index: 1;
}
.nuclide-diff-view-navigation-target.icon::before {
  margin-right: 0;
}
/*
 * Animation originally taken from [atom/settings-view][1] to match its installing/uninstalling
 * buttons.
 *
 * [1] https://github.com/atom/settings-view/blob/cc409bacf1c44dbd7d27626809b11ea7a01639a0/styles/package-card.less#L296
 */
@keyframes btn-progress {
  100% {
    background-position: -10px 0px;
  }
}
/*
 * Prepend another class selector, `nuclide-diff-view-component` in this case, to beat the
 * specificity of core styles with 2 classes + 1 tag.
 */
.nuclide-diff-view-component .btn.btn-progress,
.nuclide-diff-view-component .btn.btn-progress:hover {
  background-image: linear-gradient(to right, transparent 50%, rgba(0, 0, 0, 0.15) 50%);
  background-size: 10px 100%;
  animation: btn-progress 0.5s linear infinite;
}
.nuclide-diff-view-navigator-root {
  display: flex;
  width: 100%;
}
.nuclide-diff-view-navigator-file-changes-container {
  flex-grow: 1;
  overflow: scroll;
}
.nuclide-diff-view-navigator-timeline-container {
  width: 70%;
  overflow: scroll;
  display: flex;
}
.nuclide-diff-view-navigator-vertical-selector {
  min-height: 100%;
  width: 1px;
  background-color: #181a1f;
}
.nuclide-diff-view-navigator-horizontal-selector {
  min-width: 100%;
  height: 1px;
  background-color: #181a1f;
}
.nuclide-diff-view-direction {
  position: absolute;
  margin-left: 5px;
  margin-top: -3px;
}
.nuclide-diff-view-file-change-spinner {
  position: absolute;
  margin-left: 5px;
  margin-top: -2px;
}
.nuclide-diff-view-modal-diff-mode {
  display: flex;
  height: initial;
  min-height: 200px;
  overflow: scroll;
}
